    def fix(self, idx):
        if self.__lookup[idx] == self.__flip:
            self.__lookup[idx] = not self.__lookup[idx]
            self.__cnt += 1

    def unfix(self, idx):
        if self.__lookup[idx] != self.__flip:
            self.__lookup[idx] = not self.__lookup[idx]
            self.__cnt -= 1

    def flip(self):
        self.__flip = not self.__flip
        self.__cnt = len(self.__lookup)-self.__cnt


